import React, { Component } from 'react';
import 'headingeffect.css';

class FrontPageText extends Component {

  render() {
    return (
    	<div style={{color:'white',position:'relative',top:300,left:550}}>
    		<h1> ANJALI JAIN</h1>
    	</div>
    );
  }
}

export default FrontPageText;
